import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Modal from 'react-modal';

class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {
            userdata: []
        }
    }
    componentDidMount() {
        //fetch
        //ユーザーデータ取得
        fetch('/userdata')
            //fetch('/testuserdata')
            .then(res => res.json())
            .then(data => this.setState({ userdata: data }))
    }
    render() {
        return (
            <div>
                <h1>新規登録</h1>
            </div>
        )
    }
}

export default Register;
